import React from "react";

function Header() {
  return (
    <div className="flex">
      <div className="mt-5">
        <img className="h-12 ml-12" src="images/logo.png" alt="" />
      </div>
      <div className="mt-5">
        <input className="ml-40 bg-gray-800 w-96 h-8" type="text"></input>
      </div>
      <div className="mt-5 flex ml-40">
        <img className="mr-5 h-8" src="images/notification.png" alt="" />
        <img className="h-8" src="images/message.png" alt="" />
      </div>
      <img className="h-8 mt-5 ml-20" src="images/create.png" alt="" />
    </div>
  );
}

export default Header;
